As Dick Simnel described it so thoughtfully: &quot;This will keep me safe, Mother! I've the knowing of the sliding rule! I can tell the sine what to do, and the cosine likewise and work out the tangent of t'quaderatics! Come on, Mother, stop fretting and come wi' me to t'barn. You must see 'er!&quot;  
So have your fun with this peace, edit it, incorporate it ;)  
GNU Terry Pratchett!
